import React from "react";
import "./recent.css";
const Recent = props => {
  const presentation = props.presentation;
  const lastPresentation = props => {
    const data = presentation.filter(item => (item.id = presentation.length));
    return <div>{data.id}</div>;
  };
  return (
    <div className="recent">
      <p>{this.lastPresentation()}</p>
    </div>
  );
};

export default Recent;
